import React from 'react'
import { Link } from 'react-router-dom/cjs/react-router-dom.min'

const BlogListPage = () => {
    return (
        <div>
            <p>Blog Page</p>
            <Link to="/blogs/1">Blog 1</Link>
            <Link to="/blogs/2">Blog 2</Link>
        </div>
    )
}

export default BlogListPage
